import { Container } from '../StyledComponents/StyledComponents';
import Data from '../../Data';

const AboutHero = () => {
    return(
        <Container >
            <Container flex bottom={6}>
                <Container width={50} right={3} bottom={3}>
                    <h1>About</h1>
                </Container>
                <Container width={50}>
                    <p>{Data.about.description}</p>
                </Container>
            </Container>
        </Container>

    )
}

export default AboutHero;
